import ReactDOM  from "react-dom";
import React, {useState} from "react";

function App(){
    const [count,set] = React.useState(0);
    console.log(count);

    function increase(){
        set(count + 1);
    }
    function decrease(){
        set(count - 1);
    }
    
    return <div>
        <button>{count}</button>
        <button onClick={increase}>+</button>
        <button onClick={decrease}>-</button>

    </div>


}
export default App;
